import { render } from "@testing-library/react";
import React from "react";
import { Route, withRouter } from 'react-router';
import CollectionsOverview from '../CollectionsOverview/CollectionsOverview.component';
import CollectionsPage from '../../Pages/Collection/CollectionsPage.component';
import ItemPage from '../../Pages/Item/ItemPage.component';
import WithSpinner from '../../Components/WithSpinner/WithSpinner.component';

//const CollectionsOverviewSpinner = WithSpinner(CollectionsOverview);
//const CollectionsPageSpinner = WithSpinner(CollectionsPage);
//const ItemPageSpinner = WithSpinner(ItemPage);


// render = { (props) => <CollectionsOverviewSpinner  isLoading={isFetching} {...props} />}/>
//render = { (props) => <CollectionsPageSpinner  isLoading={isFetching} {...props} />}/>
const ShoppingComponents = ({ match, isFetching}) => {
    return(
        <div>
            <Route exact path={`${match.path}`}  component={CollectionsOverview}/>
            <Route exact  path = {`${match.path}/:collectionId`} component={CollectionsPage}/> 
            <Route  path = {`${match.path}/:collectionId/:itemId`} render = { (props) => <ItemPageSpinner isLoading={isFetching} {...props}/>}/> 
        </div>
    );
}

export default withRouter(ShoppingComponents);
